sealed trait DateTimePrecision

object DateTimePrecision {
  def fromString(value: String, scope: scala.xml.NamespaceBinding)(implicit fmt: scalaxb.XMLFormat[DateTimePrecision]): DateTimePrecision = fmt.reads(scala.xml.Text(value), Nil) match {
    case Right(x: DateTimePrecision) => x
    case x => throw new RuntimeException(s"fromString returned unexpected value $x for input $value")
  }
  lazy val values: Seq[DateTimePrecision] = Seq(Year, Month, Week, Day, Hour, Minute, Second, Millisecond)
}

case object Year extends DateTimePrecision { override def toString = "Year" }
case object Month extends DateTimePrecision { override def toString = "Month" }
case object Week extends DateTimePrecision { override def toString = "Week" }
case object Day extends DateTimePrecision { override def toString = "Day" }
case object Hour extends DateTimePrecision { override def toString = "Hour" }
case object Minute extends DateTimePrecision { override def toString = "Minute" }
case object Second extends DateTimePrecision { override def toString = "Second" }
case object Millisecond extends DateTimePrecision { override def toString = "Millisecond" }


