  def fromString(value: String, scope: scala.xml.NamespaceBinding)(implicit fmt: scalaxb.XMLFormat[SortDirection]): SortDirection = fmt.reads(scala.xml.Text(value), Nil) match {
    case Right(x: SortDirection) => x
    case x => throw new RuntimeException(s"fromString returned unexpected value $x for input $value")
